import React from 'react';

function Home() {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold text-purple-700">Welcome to Food Finder</h1>
      <p className="mt-4">Your personalized food recommendation system.</p>
    </div>
  );
}

export default Home;
